import Text.Pandoc (Inline(Code, Link, Span, Str, Subscript, Superscript))
import Text.Printf (printf, PrintfArg)
import Text.Read (readMaybe)
import Data.List (intercalate, unfoldr)
import qualified Data.Map.Strict as M (findMax, findMin, fromList, lookup, lookupGE, lookupLE, mapWithKey, Map)
import Data.Text as T (head, pack, unpack, tail)

import Utils (currentYear)

minPercentage :: Float
minPercentage = 1 + 0.20

nominalToRealInflationAdjuster :: Inline -> Inline
nominalToRealInflationAdjuster x@(Link _ _ (ts, _))
  | t == '$' = dollarAdjuster x
  | t == '\8383' = bitcoinAdjuster x --- official Bitcoin Unicode: '₿'/'\8383'; obsoletes THAI BAHT SIGN
  where t = T.head ts
nominalToRealInflationAdjuster x = x

-- TODO: refactor dollarAdjuster/bitcoinAdjuster - they do *almost* the same thing, aside from handling year vs dates
dollarAdjuster :: Inline -> Inline
dollarAdjuster l@(Link _ text (oldYears, _)) =
  -- if the adjustment is <X%, don't bother, it's not misleading enough yet to need adjusting:
 if (adjustedDollar / oldDollar) < minPercentage
 then Str $ T.pack ("$"++ oldDollarString)
 else Span ("", -- no unique identifier available
            ["inflationAdjusted"], -- CSS/HTML class for styling
            -- provide all 4 variables as metadata the <span> tags for possible CSS/JS processing
            [("originalYear",oldYear),("originalAmount",T.pack oldDollarString),
             ("currentYear",T.pack $ show currentYear),("currentAmount",T.pack adjustedDollarString),
             ("title", T.pack ("CPI inflation-adjusted US dollar: from nominal $"++oldDollarString'++" in "++T.unpack oldYear++" → real $"++adjustedDollarString++" in "++show currentYear)) ])
      -- [Str ("$" ++ oldDollarString), Subscript [Str oldYear, Superscript [Str ("$"++adjustedDollarString)]]]
      [Str (T.pack $ "$"++adjustedDollarString),  Span ("",["supsub"],[]) [Superscript [Str $ T.pack $ "$" ++ oldDollarString'], Subscript [Str oldYear]]]
    where -- oldYear = '$1970' → '1970'
          oldYear = T.tail oldYears
          oldDollarString = filter (/= '$') $ inlinesToString text -- '$50.50' → '50.50'
          oldDollar = case (readMaybe (filter (/=',') oldDollarString) :: Maybe Float) of
                        Just d -> d
                        Nothing -> error (show l)
          -- control potentially spurious precision:
          -- round to 2 digits when converting to String if a decimal was present and the inflation factor is <10x, otherwise, round to whole numbers.
          -- So, '$1.05' becomes '$20.55', but '$1' becomes '$20' instead of '$20.2359002', and '$0.05' can still become '$0.97'
          precision = if ('.' `elem` oldDollarString) && ((adjustedDollar < 10*oldDollar) || (adjustedDollar < 1)) then "2" else "0"
          oldDollarString' = formatDecimal oldDollar precision
          adjustedDollar = dollarAdjust oldDollar (T.unpack oldYear)
          adjustedDollarString = formatDecimal adjustedDollar precision

dollarAdjuster x = x

inlinesToString :: [Inline] -> String
inlinesToString = concatMap go
  where go x = case x of
               Str s    -> T.unpack s
               Code _ s -> T.unpack s
               _        -> " "

-- dollarAdjust "5.50" "1950" → "59.84"
dollarAdjust :: Float -> String -> Float
dollarAdjust amount year = case (readMaybe year :: Maybe Int) of
                             Just oldYear -> inflationAdjustUS amount oldYear currentYear
                             Nothing -> error (show amount ++ " " ++ year)

--
-- 0th: 1913 ... 104th: 2017; repeat last inflation rate indefinitely to project forward for 2018+
-- CPI: 1913-1958
-- PCE: 1959
-- https://en.wikipedia.org/wiki/Personal_consumption_expenditures_price_index
-- "When gauging inflation and the overall economic stability of the United States, the Federal Reserve prefers to use the PCE Index. The CPI is the most well-known economic indicator, and the PCE is largely forgotten. However, the Federal Reserve prefers the PCE index when reviewing economic conditions and fiscal policy, inflation, and employment. The PCE is preferred because it is composed of a broad range of expenditures. While the CPI helps to depict shifts or changes in consumer expenditures, it only reveals changes in those expenditures that fall within the pre-established fixed basket. The PCE, on the other hand, includes a broad range of household expenses. The PCE is also weighted by data acquired through business surveys, which tend to be more reliable than the consumer surveys used by the CPI." https://www.investopedia.com/terms/p/pce.asp https://www.forbes.com/sites/scottwinship/2015/06/15/debunking-disagreement-over-cost-of-living-adjustment/
inflationRatesUS :: [Float]
inflationRatesUS = let -- CPI: http://www.usinflationcalculator.com/inflation/consumer-price-index-and-annual-percent-changes-from-1913-to-2008/ 1913--1958
    cpi19131958 = [0.0,1.0,2.0,12.6,18.1,20.4,14.5,2.6,-10.8,-2.3,2.4,0.0,3.5,-1.1,-2.3,-1.2,0.6,-6.4,-9.3,-10.3,0.8,1.5,3.0,1.4,2.9,-2.8,0.0,0.7,9.9,9.0,3.0,2.3,2.2,18.1,8.8,3.0,-2.1,5.9,6.0,0.8,0.7,-0.7,0.4,3.0,2.9,1.8] -- [1.7,1.4,0.7,1.3,1.6,1.0,1.9,3.5,3.0,4.7,6.2,5.6,3.3,3.4,8.7,12.3,6.9,4.9,6.7,9.0,13.3,12.5,8.9,3.8,3.8,3.9,3.8,1.1,4.4,4.4,4.6,6.1,3.1,2.9,2.7,2.7,2.5,3.3,1.7,1.6,2.7,3.4,1.6,2.4,1.9,3.3,3.4,2.5,4.1,0.1,2.7,1.5,3.0,1.7,1.5,0.8,0.7,2.1,2.1,]
                       -- https://www.bea.gov/system/files/2019-08/pi0719_hist.pdf#page=3 "Annual Personal Income, DPI, PCE And Personal Saving: Levels And Percent Changes" 1959--2018
    pce19592018 = [5.7,2.7,2.1,4.9,4.1,6.0,6.3,5.7,3.0,5.8,3.7,2.4,3.8,6.1,4.9,-0.8,2.3,5.6,4.2,4.4,2.4,-0.3,1.4,1.5,5.7,5.3,5.2,4.1,3.4,4.2,2.9,2.0,0.2,3.7,3.5,3.9,3.0,3.5,3.8,5.3,5.3,5.1,2.5,2.6,3.2,3.8,3.6,3.1,2.2,-0.2,-1.3,1.7,1.9,1.5,1.5,3.0,3.7,2.7,2.6,3.0]
    in (cpi19131958 ++ pce19592018) ++ repeat (last pce19592018)

-- inflationAdjustUS 1 1950 2019 → 10.88084
-- inflationAdjustUS 5.50 1950 2019 → 59.84462
inflationAdjustUS :: Float -> Int -> Int -> Float
inflationAdjustUS d yOld yCurrent = if yOld>=1913 && yCurrent>=1913 then d * totalFactor else d
  where slice from to xs = take (to - from + 1) (drop from xs)
        percents = slice (yOld-1913) (yCurrent-1913) inflationRatesUS
        rates = map (\r -> 1 + (r/100)) percents
        totalFactor = product rates

-- prettyprint decimals with commas for generating larger amounts like "$50,000"
-- https://stackoverflow.com/a/4408556
formatDecimal :: (Ord a, Fractional a, Text.Printf.PrintfArg a) => a -> String -> String
formatDecimal d prec
    | d < 0.0   = "-" ++ formatPositiveDecimal (-d)
    | otherwise = formatPositiveDecimal d
    where formatPositiveDecimal = uncurry (++) . mapFst addCommas . span (/= '.') . printf ("%0."++ prec ++ "f")
          addCommas = reverse . intercalate "," . unfoldr splitIntoBlocksOfThree . reverse
          splitIntoBlocksOfThree l = case splitAt 3 l of ([], _) -> Nothing; p-> Just p
          -- https://hackage.haskell.org/package/fgl-5.7.0.1/docs/src/Data.Graph.Inductive.Query.Monad.html#mapFst
          mapFst :: (a -> b) -> (a, c) -> (b, c)
          mapFst f (x,y) = (f x,y)

bitcoinAdjuster :: Inline -> Inline
bitcoinAdjuster l@(Link _ text (oldDates, _)) =
 if (adjustedBitcoin / oldBitcoin) < minPercentage
 then Str $ T.pack ("\8383"++oldBitcoinString)
 else Span ("",
            ["inflationAdjusted"],
            [("originalYear",oldDate),         ("originalAmount",T.pack oldBitcoinString),
             ("currentYear",T.pack $ show currentYear), ("currentAmount", T.pack adjustedBitcoinString),
             ("title", T.pack ("Exchange-rate-adjusted currency: \8383"++oldBitcoinString++" in "++T.unpack oldDate++" → $"++adjustedBitcoinString)) ])
      [Str (T.pack $ "$"++adjustedBitcoinString),  Span ("",["supsub"],[]) [Superscript text, Subscript [Str (T.pack oldYear)]]]
  where oldDate = T.tail oldDates
        oldBitcoinString = filter (/= '\8383') $ inlinesToString text
        oldBitcoin = case (readMaybe (filter (/=',') oldBitcoinString) :: Maybe Float) of
                       Just ob -> ob
                       Nothing -> error (show l)
        oldYear = take 4 $ T.unpack oldDate -- it takes up too much space to display full dates like '2017-01-01'; readers only really need the year; the exact date is provided in the tooltip
        precision = if ('.' `elem` oldBitcoinString) && ((adjustedBitcoin < 10*oldBitcoin) || (adjustedBitcoin < 1)) then "2" else "0"
        adjustedBitcoin = bitcoinAdjust oldBitcoin (T.unpack oldDate)
        adjustedBitcoinString = formatDecimal adjustedBitcoin precision
bitcoinAdjuster x = x

-- convert to historical USD, and then inflation-adjust the then-exchange rate to the present day for a real value
bitcoinAdjust :: Float -> String -> Float
bitcoinAdjust oldBitcoin oldDate = oldBitcoin * bitcoinQuery oldDate

-- Look up USD/₿ daily exchange rate for a given day using a hardwired exchange rate database; due to the extreme volatility of Bitcoin, yearly exchange rates are not precise enough.
-- If the requested date is after the last available date, the last exchange rate is carried forward indefinitely; if the date is inside the database range but not available (due to spotty time-series), linearly interpolate (average) the two nearest rates before & after; if the date is before the first well-known Bitcoin purchase (Pizza Day), carry that backwards indefinitely.
bitcoinQuery :: String -> Float
bitcoinQuery date = case M.lookup date bitcoinExchangeRate of
                      Just rate -> rate
                      -- like inflation rates, we carry forward the last available exchange rate
                      Nothing -> let (lastDate,lastRate) = M.findMax bitcoinExchangeRate in
                                   let (firstDate,firstRate) = M.findMin bitcoinExchangeRate in
                                       if date > lastDate then lastRate else
                                         if date < firstDate then firstRate else
                                           let Just (_,after) = M.lookupGE date bitcoinExchangeRate in
                                             let Just (_,before) = M.lookupLE date bitcoinExchangeRate
                                             in (after + before) / 2

